import { Container, Row, Col } from 'react-bootstrap';
import 'containers/About/About.css';

const about = () => {
        return(
<Container className = "about-section" fluid>
        <Row><Col>
           <h1>About</h1>
           <p>re-set allows you to browse artist's past concert setlists and convert them into Spotify playlists, whether you're re-living
               a past experience or getting ready for a future show.</p>

               <p>This is a personal project  I built to help myself learn React</p>

        </Col></Row>
</Container>
        )
}

export default about;
